import defaultTemplate from './default';
import modernResumeTemplate from './modern_resume';
import academicCvTemplate from './academic_cv';
import jakeResumeTemplate from './jake_resume';

// Collection of all available templates
const templates = {
  default: {
    name: "Simple Resume",
    description: "Basic resume layout suitable for most job applications",
    template: defaultTemplate
  },
  modern: {
    name: "Modern Professional",
    description: "Clean, contemporary layout with enhanced formatting",
    template: modernResumeTemplate
  },
  academic: {
    name: "Academic CV",
    description: "Detailed format suitable for academic and research positions",
    template: academicCvTemplate
  },
  jake: {
    name: "Jake's ATS-Friendly Resume",
    description: "Clean, well-structured format optimized for ATS systems",
    template: jakeResumeTemplate
  }
};

export default templates;
